    akoaowkaowk`, by: "amek"},
    {_id: 4, isi:"awokaowk", by: "amek"},
    {_id: 5, isi:"be yourself", by: "amek"},
    {_id: 6, isi:`swaoskaowskawopskaw
    a 
    a
    a
    a
    a
    a
    a
    pslapwsoawpsow`, by: "amek"},
  ])

  return (
    <div className="bg-secondary w-full h-screen ">
      <BrowserRouter>
        <Navbar />
        <Switch>
          <Route path="/home" exact>
            <Home/>
          </Route>
        </Switch>
      </BrowserRouter>
        <Utama quoteList={quote}/>
    </div>
  );
}

export default App;
